// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "./ProposalLinkedList.sol";
import  "@openzeppelin/contracts/utils/cryptography/SignatureChecker.sol";
import "@openzeppelin/contracts/utils/introspection/ERC165.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "./library/LinkedList.sol";

contract PtoPList{
    using LinkedListLib for LinkedListLib.UintLinkedList;

    IERC20 public token;
    address private administrator;

    constructor(address _token,address _administrator){
        token = IERC20(_token);
        administrator = _administrator;
    }

    modifier onlyadministrator{
        require(msg.sender == administrator);
        _;
    }

    LinkedListLib.UintLinkedList Nodes;
    mapping(address => mapping(uint256 => uint256)) orderIndex;
    mapping(uint256 => Order) orderList;

    uint256 nftCounter;

    enum States{
        created,            //借贷已创建
        lended,             //借款人已拨款
        borrowed,           //还钱人已还钱
        finished            //本次借贷已结束  
    }

    struct Order{
        uint256 blockNumber;        // 区块号         
        address borrower;           // 申请借款的人
        uint256 price;              // 申请借贷价格
        uint256 loanTime;           // 借贷时间
        uint256 borrowTime;         // 拨款时间
        address lender;             // 借款人
        NFT nft;                    // NFT信息
        States state;
    }

    struct NFT{
        address nftAddress;         //NFT地址
        uint256 tokenId;            //tokenID
        NftType nftType;            // NFT类型
        uint256 amount;             // NFT代币数量 

    }

    enum NftType{                   //记录NFT的类型
        ERC721,
        ERC1155,
        Others
    }

    //创建借钱需求
    function createP2POrder(address _nftAddress,
        uint256 _tokenId,
        uint256 _amount,
        uint256 _price,
        uint256 _loanTime)public {
        NftType types = identifyNFT(_nftAddress);
        NFT memory nfts = NFT(
            _nftAddress,
            _tokenId,
            types,
            _amount
        );
        Order memory order = Order({
                blockNumber: block.number,
                borrower: msg.sender,
                price:_price,
                loanTime:_loanTime,
                borrowTime: 0,
                lender:address(0x0),
                state:States.created,
                nft:nfts
        });
        nftCounter++;
        orderList[nftCounter] = order;
        orderIndex[_nftAddress][_tokenId] = nftCounter;
        nftTransfer(_nftAddress,_tokenId,msg.sender,address(this),_amount);
        Nodes.add(nftCounter);

        //TODO event
    }

    //借钱者撤回NFT
    function revokeOrder(uint256 index) external{
        require(msg.sender == orderList[index].borrower);
        uint256 amount = orderList[index].nft.amount;
        address _nftAddress = getNftAddressByIndex(index);
        uint256 _tokenId = getTokenIdByIndex(index);
        nftTransfer(_nftAddress,_tokenId,address(this),msg.sender,amount);
        orderList[index].state = States.finished;
        nftCounter--;
        Nodes.remove(index);


    }

    //借钱
    function lend(uint256 index) external {
        require(orderList[index].state == States.created);
        token.transferFrom(
            orderList[index].lender,
            orderList[index].borrower,
            orderList[index].price
        );
        orderList[index].lender = msg.sender;
        orderList[index].borrowTime = block.timestamp;
        orderList[index].state = States.lended;


    }

    //还钱
    function borrow(uint256 index) external {
        require(
            (block.timestamp - 
            orderList[index].borrowTime) <= 
            orderList[index].loanTime   
        );
        require(msg.sender == orderList[index].borrower);
        uint256 price = getBorrowPrice(orderList[index].price);
        address _nftAddress = getNftAddressByIndex(index);
        uint256 _tokenId = getTokenIdByIndex(index);
        token.transferFrom(
            orderList[index].borrower,
            orderList[index].lender,
            price
        );
        orderList[index].state = States.borrowed;
        // nfts[index] = nfts[length];
        // length --;
        nftCounter--;
        Nodes.remove(index);
        uint256 amount = orderList[index].nft.amount;
        nftTransfer(_nftAddress,_tokenId,address(this),msg.sender,amount);
    
    }

    //获取还钱的利息
    function getBorrowPrice(uint256 price) internal pure returns(uint256) {
        return price;
    }

     //设置还钱的利息
    function setBorrowPricePercentage() external onlyadministrator {

    }
    
    //超时后lender可随时将nft从本合约提走
    function timeOut(uint256 index) external {
        require(
            (block.timestamp - 
            orderList[index].borrowTime) > 
            orderList[index].loanTime   
        );
        require(msg.sender == orderList[index].lender);
        address _nftAddress = getNftAddressByIndex(index);
        uint256 _tokenId = getTokenIdByIndex(index);
        uint256 amount = orderList[index].nft.amount;
        nftTransfer(_nftAddress,_tokenId,address(this),msg.sender,amount);
        orderList[index].state = States.finished;

    }

    //通过下标获取NFT地址
    function getNftAddressByIndex(uint256 index) public view returns(address NftAddress){
        NftAddress = orderList[index].nft.nftAddress;
    }

    //通过下标获取代币ID
    function getTokenIdByIndex(uint256 index) public view returns(uint256 tokenId){
        tokenId = orderList[index].nft.tokenId;
    }

    function setAdministrator(address _address)external onlyadministrator returns(address){
        return administrator = _address;
    }

    //NFT转账
    function nftTransfer(
        address _nftAddress,
        uint256 _tokenId,
        address _sender,
        address _recipient,
        uint256 amount
    ) internal {
        if(orderList[orderIndex[_nftAddress][_tokenId]].nft.nftType == NftType.ERC721){
            IERC721 Nft = IERC721(_nftAddress);
            Nft.transferFrom(_sender, _recipient, _tokenId);
        }else if(orderList[orderIndex[_nftAddress][_tokenId]].nft.nftType == NftType.ERC1155){
            IERC1155 Nft = IERC1155(_nftAddress);
            Nft.safeTransferFrom(_sender, _recipient, _tokenId,amount,"");
        }else{
            revert();
        }
    }

    //查询一个NTF是721还是1155
    function identifyNFT(address nftAddress) public view returns (NftType) {
        ERC165 nftInterface = ERC165(nftAddress);
        if (nftInterface.supportsInterface(type(IERC721).interfaceId)) {
            return NftType.ERC721;
        } else if (nftInterface.supportsInterface(type(IERC1155).interfaceId)) {
            return NftType.ERC1155;
        } else {
            return NftType.Others;
        }
    }

    //获取目标节点后目标数量节点
    function getNodes(uint256 current,uint256 number)external view returns(Order[] memory){
        Order[] memory orders = new Order[](number);
        Order memory orderGet;
        LinkedListLib.UintNode memory nodeGet;
        for(uint i ;i <= number ;i++){
            nodeGet =  Nodes.getNode(current);
            orderGet = orderList[nodeGet.current];
            orders[i + 1] = orderGet;
            current = nodeGet.next;
        }
        return orders;
    }



}

